import React from "react";
import ArtThumbnail from "./Art Thumbnail"

function Gallery (props) {

    return (
        <div className="artwork-thumbnails">
            <ArtThumbnail 
            artWorkSrc = {props.artWorkSrc}  
            artWorkTitles = {props.artWorkTitles}/>
        </div>
    )
}

export default Gallery;
